const PatientRow = (props) => {

    return (
        <div className="grid grid-cols-3 mt-8">
            <div>AV</div>
            <div>
                <p>{props.name}</p>
                <p>{props.type}</p>
            </div>
            <div className="rounded-lg ">{props.time}</div>
        </div>
    );
}

export default PatientRow;
